import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Home from './components/Home'; // Cambiado de PersonList a Home
import Register from './components/Register';
import UpdatePerson from './components/UpdatePerson';
import MapView from './components/MapView';
import 'bootstrap/dist/css/bootstrap.min.css';
import PersonaService from './services/PersonaService';
import {DataTable} from 'primereact/datatable'
import { Column } from 'primereact/column';
import { Panel } from 'primereact/panel';


export default class App extends Component{
    constructor(){
        super();
        this.state ={}
        this.personaService = new PersonaService();

    }

    componentDidMount(){
       this.personaService.getAll().then(data =>this.setState({personas: data}))
        
    }
    render(){
        return (
            <Panel header="React CRUD App">
            <DataTable value={this.state.personas} >
            <Column field="id" header="ID"></Column>
            <Column field="primerNombre" header="primerNombre"></Column>
            <Column field="segundoNombre" header="segundoNombre"></Column>
            </DataTable>
            </Panel>
        );
}

}
